CREATE DATABASE "curso-jsp"
    WITH 
    OWNER = postgres
    ENCODING = 'UTF8'
    LC_COLLATE = 'pt_BR.UTF-8'
    LC_CTYPE = 'pt_BR.UTF-8'
    TABLESPACE = pg_default
    CONNECTION LIMIT = -1;

CREATE SEQUENCE public.serialprod
    INCREMENT 1
    START 1
    MINVALUE 1
    MAXVALUE 9223372036854775807
    CACHE 1;

ALTER SEQUENCE public.serialprod
    OWNER TO postgres;

CREATE TABLE public.produto
(
    id bigint NOT NULL DEFAULT nextval('serialprod'::regclass),
    nome character varying COLLATE pg_catalog."pt_BR.utf8",
    quantidade bigint,
    valor numeric(10,4),
    CONSTRAINT produto_pkey PRIMARY KEY (id)
)
WITH (
    OIDS = FALSE
)
TABLESPACE pg_default;

ALTER TABLE public.produto
    OWNER to postgres;

CREATE SEQUENCE public.serialfone
    INCREMENT 1
    START 1
    MINVALUE 1
    MAXVALUE 9223372036854775807
    CACHE 1;

ALTER SEQUENCE public.serialfone
    OWNER TO postgres;

CREATE TABLE public.telefone
(
    id bigint NOT NULL DEFAULT nextval('serialfone'::regclass),
    numero character varying COLLATE pg_catalog."pt_BR.utf8",
    tipo character varying COLLATE pg_catalog."pt_BR.utf8",
    usuario bigint NOT NULL,
    CONSTRAINT fone_pkey PRIMARY KEY (id),
    CONSTRAINT usuario_fkey FOREIGN KEY (usuario)
        REFERENCES public.usuario (id) MATCH SIMPLE
        ON UPDATE NO ACTION
        ON DELETE CASCADE
)
WITH (
    OIDS = FALSE
)
TABLESPACE pg_default;

ALTER TABLE public.telefone
    OWNER to postgres;

CREATE SEQUENCE public.serialuser
    INCREMENT 1
    START 1
    MINVALUE 1
    MAXVALUE 9223372036854775807
    CACHE 1;

ALTER SEQUENCE public.serialuser
    OWNER TO postgres;

CREATE TABLE public.usuario
(
    login character varying COLLATE pg_catalog."pt_BR.utf8",
    senha character varying COLLATE pg_catalog."pt_BR.utf8",
    id bigint NOT NULL DEFAULT nextval('serialuser'::regclass),
    nome character varying COLLATE pg_catalog."pt_BR.utf8",
    cep character varying COLLATE pg_catalog."pt_BR.utf8",
    rua character varying COLLATE pg_catalog."pt_BR.utf8",
    bairro character varying COLLATE pg_catalog."pt_BR.utf8",
    cidade character varying COLLATE pg_catalog."pt_BR.utf8",
    uf character varying COLLATE pg_catalog."pt_BR.utf8",
    ibge character varying COLLATE pg_catalog."pt_BR.utf8",
    fotobase64 text COLLATE pg_catalog."pt_BR.utf8",
    contenttypefoto character varying COLLATE pg_catalog."pt_BR.utf8",
    curriculobase64 text COLLATE pg_catalog."pt_BR.utf8",
    contenttypecurriculo character varying COLLATE pg_catalog."pt_BR.utf8",
    fotobase64miniatura text COLLATE pg_catalog."pt_BR.utf8",
    ativo boolean,
    sexo character varying COLLATE pg_catalog."default",
    perfil character varying COLLATE pg_catalog."default",
    CONSTRAINT usuario_pkey PRIMARY KEY (id)
)
WITH (
    OIDS = FALSE
)
TABLESPACE pg_default;

ALTER TABLE public.usuario
    OWNER to postgres;

